"""Functions to connect to relevant VGG19 layers and assign to 'content' and 'style' function"""

#Function to call VGG-19 layers
def vgg19(layers):
    '''
    Parameters:layers- list of str (List of the name of the layers we want to use in vgg19.)
   ----------
    Returns: vgg models
    -------
    '''
    vgg = tf.keras.applications.VGG19(include_top=False, weights='imagenet')
    outputs = []
    for layer in layers:
        outputs.append(vgg.get_layer(layer).output)
    model = tf.keras.Model(vgg.input,outputs)
    model.trainable = False
    return model


#Function to define VGG19 layers to be used for Content & style
class Content_Style_outputs(tf.keras.Model):
    def __init__(self, content_layers, style_layers):
        '''
        Parameters:
        content_layers : list of str
            list of name of layers in vgg19 used to evaluate the content.
        style_layers : list of str
            list of name of layers in vgg19 used to evaluate the style.
      --------------
        Returns: None
        -------------
        '''
        super(Content_Style_outputs, self).__init__()
        self.content = content_layers
        self.style = style_layers
        layers = []
        # content first and then style
        for i in self.content:
            layers.append(i)
        for j in self.style:
            layers.append(j)
        self.vgg = vgg19(layers)
        
  
  #Function to call the Content and style Output
    def call(self, inputs, training=None, mask=None):
        '''
        Parameters:
        ----------
        inputs : tensor
            The input figure
        training : TYPE, optional
            The default is None.
        mask : TYPE, optional
            The default is None.
        Returns:
        -------
        tuple of content output and style output
        '''
        outputs = self.vgg(inputs)
        output_content = []
        output_style = []
        for i in range(len(outputs)):
            if i<len(self.content):
                output_content.append(outputs[i][0])
            else:
                output_style.append(outputs[i][0])
        return (output_content, output_style)

"""Functions to Pre-process and save the Content and style image"""

#Function to normalize the input images
def normalization(x, mean, std):
    return (x-mean)/std

#Function to load and read the images
def load_images(path, width, height, mean, std):
    x = tf.io.read_file(path)
    x = tf.image.decode_jpeg(x, channels=3)
    x = tf.image.resize(x, size=[height, width])
    x = x/255
    x = normalization(x, mean, std)
    x = tf.reshape(x, [1, height, width, 3])
    return x

#Function to save output images post processing
def save_image(image, path, mean, std):
    x = tf.reshape(image, image.shape[1:])
    x = x*std+mean
    x = x*255
    x = tf.clip_by_value(x,0,255)
    x = tf.cast(x,tf.uint8)
    x = tf.image.encode_jpeg(x)
    tf.io.write_file(path,x)

