def gram(x):
    input_tensor = tf.reshape(x, [1, tf.shape(x)[0],  tf.shape(x)[1],  tf.shape(x)[2]])
    result = tf.linalg.einsum('bijc,bijd->bcd', input_tensor, input_tensor)
    input_shape = tf.shape(input_tensor)
    num_locations = tf.cast(input_shape[1]*input_shape[2]*input_shape[3], tf.float32)
    return result/(num_locations)

def compute_style_loss_once(x, target):
    x_gram = gram(x)
    target_gram = gram(target)
    loss = tf.reduce_sum(tf.square(x_gram-target_gram))
    return loss

def compute_style_loss(xs, targets):
    losses = []
    for i in range(len(xs)):
        temp = compute_style_loss_once(xs[i], targets[i])
        losses.append(temp)
    return tf.reduce_sum(losses)/len(losses)

def loss(x, contents, styles, factor_cont, factor_sty):
    content_loss = compute_content_loss(x[0], contents)
    style_loss = compute_style_loss(x[1], styles)
#     print(style_loss)
